import { Input, Button } from "reactstrap";
import "./Input.css"

const InputDefault = () => {
    return (<div className="container-input">

        <Input>
        <Button>
           <img src="./imagens/lupa.png"/>
        </Button>
        </Input>
    </div>);
}

export default InputDefault;
